import React from "react";
import AppointmentCard from "./AppointmentCard.js";

function AppointmentCardList({ data }) {
  console.log("AppointmentCardList data:", data);

  return (
    data.map((reservation) => (
      <AppointmentCard
        key={reservation.id}
        tutor_first_name={reservation.tutor.tutor_first_name}
        tutor_last_name={reservation.tutor.tutor_last_name}
        date={reservation.date}
        time={reservation.time}
        subject={reservation.subject}
      />
    ))
  );
}

export default AppointmentCardList;
